import React from 'react';
import logo from './logo.svg';
import './App.css';
import QuestionsList from "./view/QuestionsList";
questions: [{
  title: "Blender3D",
  question: "What does it do?"
}, {
  title: "Kittens",
  question: "Are they fluffy?"
}]

function App() {
  return (
    <div className="App">

      <QuestionsList questions={questions}/>

    </div>
  );
}

export default App;
